class Solution:
    def minExtraChar(self, s: str, dictionary: List[str]) -> int:
        ss = set(dictionary)
        n = len(s)
        f = [0] * (n + 1) * n
        for i in range(n + 1):
            for j in range(n * n):
                if j < i:
                    f[j * (n + 1) + i] = i
                else:
                    f[j * (n + 1) + i] = i + 1
                for k in range(i):
                    if s[k:i] in ss and f[j * (n + 1) + k] < f[j * (n + 1) + i]:
                        f[j * (n + 1) + i] = f[j * (n + 1) + k]
        f = [0] * (n + 1) * n
        for i in range(n + 1):
            for j in range(n * n):
                f[j * (n + 1) + i] = max(f[j * (n + 1) + i], f[j * (n + 1) + i - 1])
                for k in range(i):
                    if s[k:i] in ss and f[j * (n + 1) + k] < f[j * (n + 1) + i]:
                        f[j * (n + 1) + i] = f[j * (n + 1) + k]
        return f[-1]
